INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (1589, CONCAT('Saint Seiya Omega'), CONCAT('The god of war and guardian of his namesake planet, Mars, was once sealed away by Seiya, but time has passed and his revival is at hand. Meanwhile, Saori Kido (Athena) is raising the boy Kouga, whose life Seiya saved, and he', CHAR(39), 's been training every day to become a Saint in order to prepare for the coming crisis... <br><br>Unaware of his destiny, when Kouga awakens to the power of his Cosmo hidden inside him, the curtain will rise upon the legend of a new Saint.<br><br>(Source: ANN)'), 3, '2012-04-01', '2014-03-30', 'Spring 2012', '23 min. per ep.', 'https://cdn.myanimelist.net/images/anime/8/76052.jpg');
